import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { byPrefixAndName } from "@awesome.me/kit-KIT_CODE/icons";
import { Table } from "react-bootstrap";
import { useState } from "react";

export default function Tablazat(tabla) {
  const pipa = <FontAwesomeIcon icon={byPrefixAndName.fas["check"]} />;
  const X = <FontAwesomeIcon icon={byPrefixAndName.fas["xmark"]} />;
  const [valasz, setValasz] = useState([]);
  
  return (
    <div>
      <h1>Szavak</h1>
      <Table>
        <thead>
          <tr>
            <th>Angol</th>
            <th>Magyar</th>
            <th>Visszajelz√©s</th>
          </tr>
        </thead>
        <tbody>
          {tabla.map((item, index) => (
            <tr key={index}>
              <td>{index + 1}</td>
              <td>{item.angol}</td>
              <td>
                <input value={valasz} type="text" />
              </td>
              <td> {item.magyar === valasz ? pipa : X}</td>
            </tr>
          ))}
        </tbody>
      </Table>
    </div>
  );
}
